import Form from "../Form/Form";
import Button from "../Button/Button"
import React, {useState} from 'react'

export default function Table(props) {

  const [user, setUser] = useState('')
  const handleSubmit = (e) => {
    e.preventDefault()
    console.log(user)

  }




  return (
    <div className="adjust">
    <div className="containerTable">
        <Form onSubmit={handleSubmit} type="text" input='table' place='Noteno' onChange={(e) => 
          {setUser(e.target.value)}} value ={user} required />
        <Form type="text" input='table' place='Title'/>
        <Form type="text" input='table' place='Created by'/>
        <Form type="date" input='table' place='Created on'/>
        <Form type="text" input='table' place='content'/>
    </div>
    <div className="h3">
      <h3>NoteNo</h3>
      <h3>Title</h3>
      <h3>Created By</h3>
      <h3>Created on</h3>
      <h3>Content</h3>

    </div>
    <div className="buttonnode">
      <Button class='edit' name='Submit' type='Submit'/>
    </div>
    </div>
  );
}
